/**
 * submitPopupForm function
 * @param  {String} form   is a querySelector of any form
 * @param  {Boolean}       isCallbackForm
 */

function submitPopupForm(form, isCallbackForm){
    /**
     * formPopupNumberId - is way to identify what type of form is present form - callback or baseOrder
     */
    var $form = $(form);
    var formPopupNumberId = isCallbackForm ? "popup-1" : "popup-2";
    /*  prepare serialized array for the addition of a form type identifier  */
    var form_data = $(form).serializeArray();
    form_data.push({name: "form_number", value: formPopupNumberId});
    form_data = $.param(form_data);


    $.ajax({
      url: '/send.php',
      type: 'POST',
      data: form_data,
      beforeSend: function (r) {
        $('.sweet-modal-content .site-form').hide();
        $('.sweet-modal-title h2').html(' ...');
        $('.sweet-modal-content').append('<div class="sweet-modal-icon noBorder"><div class="loader_circle"> <div class="circle one"></div> <div class="circle two"></div> <div class="circle three"></div> </div></div>');

      },
      complete: function (r) {
        console.log(r);
        $form.trigger('reset');
        $('.sweet-modal-title h2').html('');
        $('.sweet-modal-content').html('<div class="sweet-modal-icon sweet-modal-success animate"> <span class="sweet-modal-line sweet-modal-tip animateSuccessTip"></span> <span class="sweet-modal-line sweet-modal-long animateSuccessLong"></span> <div class="sweet-modal-placeholder"></div> <div class="sweet-modal-fix"></div> </div><div class="success-text">   </div>');
        // var to = setTimeout(function () {
        //   $('.sweet-modal-close-link').click();
        // },3000);

      }
    });
  };


function submitBasicForm(form) {
  var $form = $(form);
  var form_data = $form.serialize();
  var form_number = $(form).find('[name="form_number"]').val();

  $.ajax({
    url: '/send.php',
    type: 'POST',
    data: form_data,
    beforeSend: function (r) {
      $.sweetModal({
       content: '<div class="sweet-modal-icon noBorder" id="submitBasicForm"><div class="loader_circle"> <div class="circle one"></div> <div class="circle two"></div> <div class="circle three"></div> </div></div>',
       title: ' ...',
        theme: $.sweetModal.THEME_DARK,
      });

      },
    complete: function (r) {
      console.log(r);
      $form.trigger('reset');
      /**
       * do some actions depending on the form_number
       */

             $('.sweet-modal-title h2').html('');
             $('.sweet-modal-content').html('<div class="sweet-modal-icon sweet-modal-success animate"> <span class="sweet-modal-line sweet-modal-tip animateSuccessTip"></span> <span class="sweet-modal-line sweet-modal-long animateSuccessLong"></span> <div class="sweet-modal-placeholder"></div> <div class="sweet-modal-fix"></div> </div><div class="success-text">   </div>');

    }
  });
}


